import React, { Component } from 'react';
import homepageImage from './assets/homepage.jpg'
import Typist from 'react-typist';
import './index.css';

class App extends Component {
  componentDidMount() {
    window.addEventListener('scroll', this.handleHeaderSCroll)
  }

  handleHeaderSCroll = () => {
    var header = document.getElementById("header-bar")
    header.classList.toggle("sticky", window.scrollY > 0)
  }

  render() {
    return (
      <div className="App">
        <header className="header" id="header-bar">
          <label className="header-logo">Portfolio</label>
          <ul>
            <li>Home</li>
            <li>Contact</li>
            <li>Skills</li>
            <li>Experience</li>
          </ul>
        </header>
        <section className="home">
          <img src={homepageImage} />
          <Typist cursor={{show: false}} className="home-typist">
            <h1> Hello I'm </h1>
            {/* <Typist.Delay ms={500} /> */}
            {/* <br /> */}
            <h3>Ahammed Shaqil </h3>
            {/* <Typist.Delay ms={500} /> */}
            {/* <br /> */}
            <h2> I'm a Front End web developer<Typist.Delay ms={500} /> .</h2>
          </Typist>
        </section>
      </div>
    );
  }
}

export default App;
